package leetcode.problem_0438;

import Utilities.java.ListUtils;
import org.junit.Test;

import java.util.List;

import static org.junit.Assert.assertEquals;

public class SolutionTest {

    private final Solution solution = new Solution();

    @Test
    public void findAnagrams_1() {
        final String s = "cbaebabacd";
        final String p = "abc";

        final List<Integer> result = solution.findAnagrams(s, p);

        assertEquals(ListUtils.createList(0, 6), result);
    }

    @Test
    public void findAnagrams_2() {
        final String s = "abab";
        final String p = "ab";

        final List<Integer> result = solution.findAnagrams(s, p);

        assertEquals(ListUtils.createList(0, 1, 2), result);
    }

    @Test
    public void findAnagrams_3() {
        final String s = "";
        final String p = "";

        final List<Integer> result = solution.findAnagrams(s, p);

        assertEquals(ListUtils.createList(0, 10001), result);
    }
}